# write the correlation coefficient matrix to a file
def writeToFile(matrix, filename):
    file = open(filename, 'w')
    for row in range(len(matrix)):
        string = ''
        for col in range(len(matrix[0])):
            string += str(matrix[row][col]) + '   '
        file.write(string + '\n')
    return

